var jaJP={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"許可する","Allow in your wallet":"ウォレットで許可する","Allow {symbol} first":["最初に ",["symbol"]," を許可"],"Allowance pending":"保留中の手当","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"スワップ実行時にエラーが発生しました。スリッページの許容範囲を広げる必要がある可能性があります。それでも上手くいかない場合、取引しているトークンとの互換性がない可能性があります。注：転送時に手数料が発生するトークンおよびリベースするトークンは、UniswapV3と互換性がありません。","Approval pending":"承認待ち","Approve":"承認","Approve Permit2":"Approve Permit2","Approve in your wallet":"ウォレットで承認する","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["最初に ",["symbol"]," を承認"],"Auto":"自動","Auto Router":"自動ルーター","Auto Router API":"自動ルーターAPI","Balance:":"残高:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"閉じる","Confirm in your wallet":"ウォレットで確認する","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"ウォレットに接続","Connecting…":"接続中…","Continue":"Continue","Convert {0} to {1}":[["0"]," を ",["1"],"に変換"],"Convert {0} to {1} with no slippage":["スリッページなしで ",["0"]," を ",["1"]," に変換します"],"Disconnect wallet":"ウォレットを切断する","Dismiss":"注文を取り下げる","Enter an amount":"数量を入力してください","Error fetching trade":"取引の取得中にエラーが発生しました","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"ベストな価格を取得中…","Get support":"サポートを受ける","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"高いスリッページは価格変動のリスクを高めます","I don't have a wallet":"財布を持っていません","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":[["0"]," の残高が足りません"],"Invalid recipient":"受け取りアドレスが無効です","Max":"最大","Max slippage":"最大スリッページ","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"依存関係がありません","Network fee":"ネットワーク料金","No results found.":"結果が見つかりませんでした。","No tokens are available on this network. Please switch to another network.":"このネットワークではトークンは利用できません。別のネットワークに切り替えてください。","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"有効なスリッページ％を入力してください","Powered by the Uniswap protocol":"Uniswapプロトコルによって提供","Price impact":"価格への影響","Price updated":"価格が更新されました","Reload":"Reload","Reload the page":"ページを再読み込みする","Request rejected":"Request rejected","Review swap":"スワップを確認する","Search by token name or address":"トークン名またはアドレスで検索","Select token":"トークンを選択","Show less":"Show less","Show more":"もっと表示","Something went wrong":"何らかの問題が発生しました","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"成功","Swap":"スワップ","Swap failed: {0}":["スワップに失敗しました： ",["0"]],"Switch network":"ネットワークを切り替える","Switch network in your wallet":"ウォレット内のネットワークを切り替える","Switching network":"スイッチング ネットワーク","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Uniswap不変式 x * y = kはスワップで満たされませんでした。これは通常、スワップするトークンの1つが転送時のカスタム動作を組み込んでいることを意味します。","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"売るトークンが転送できません。売るトークンに問題がある可能性があります。","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"購入するトークンを転送できません。購入するトークンに問題がある可能性があります。","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"購入するトークンを転送できません。購入するトークンに問題がある可能性があります。注：転送時に手数料が発生するトークンおよびリベースするトークンは、UniswapV3と互換性がありません。","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"価格変動により、この取引は成功しません。スリッページの許容範囲を広げてみてください。注：転送時に手数料が発生するトークンおよびリベーストークンは、UniswapV3と互換性がありません。","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"この取引は、価格変動または転送時に手数料が発生するため、成功しません。スリッページの許容範囲を広げてみてください。","This transaction will result in a":"This transaction will result in a","Transaction deadline":"取引期限","Transaction rejected":"取引拒否","Transaction submitted":"取引は送信されました","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"スリッページの許容範囲を広げてみてください。<0/>注：転送時に手数料が発生するトークンおよびリベースするトークンは、UniswapV3と互換性がありません。","Unexpected error. Could not estimate gas for the swap.":"予期しないエラー。スワップのガスを見積もることができませんでした。","Unexpected issue with estimating the gas. Please try again.":"ガスの見積もりに関する予期しない問題。もう一度やり直してください。","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Etherscanで見る","Wallet disconnected":"Wallet disconnected","Warning":"警告","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"この期間より長く保留されている場合、トランザクションは元に戻ります。","Your transaction will revert if the price changes unfavorably by more than this percentage.":"価格が設定したパーセンテージよりも不利な価格に変動した場合、取引は差し戻されます。","minutes":"分","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," 手数料"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { jaJP as default };
